import { TextField, Button } from "@mui/material";
const Input = (name, value, label, type, error, onChange) => {
  return (
    <div>
      {(error && (
        <TextField
          error
          name={name}
          id="outlined-error-helper-text"
          label="Error"
          helperText="Incorrect entry."
        />
      )) || (
        <TextField
          name={name}
          id="outlined-basic"
          label={label}
          variant="outlined"
        />
      )}

      <TextField
        error
